import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <Router>    
      <Navbar />
      <div><h1>Welcome to brand</h1></div>
    </Router>
  );
};

export default App;
